import React from "react";
import {AppBar, Typography, Toolbar} from "@material-ui/core";

function Navbar() {
	return (
		<AppBar position="static">
			<Toolbar>
				<Typography variant="h6">SCHOLASTIC</Typography>
			</Toolbar>
		</AppBar>
	);
}

export default Navbar;
